Test driven development (TDD) is an approach to development where tests are written before the actual code. The core of TDD is a three steps process: Write a failing test Make the test pass Refactor Let's go through each step using the following specifications as example: I want measure things in meters I want to be able to some two measurements in meters Write a failing test At this step we pick a single aspect of the specification we want to verify: the smallest the better. The common mistake here is to overthink it because we want to take into account all the specifications and their nuances. Don't do it now, the third step will take care of it. For now let's just write a test even if it seems silly for how simple it is. Moreover, don't focus on writing good code either: the third step will take care of this as well. Finally, remember to run the test and see it failing with the error we expect: we do not want to later discover that our code is passing tests by luck. @Test
fun `summing 1 meter and 2 meters returns 3 meters`() { val result = MeasureInMeters(1).add(MeasureInMeters(2)) assertEquals(MeasureInMeters(3), result)
} Make the test pass Now that we have a failing test we need to make it pass. Be mindful that compilation errors in the test is the same of running it and see it fail. At this step as at the previous, let's not focus about writing good code, that's something for the third step: just make the test pass, whatever it takes. data class MeasureInMeters(private val amount: Int) { fun add(measureInMeters: MeasureInMeters): MeasureInMeters { return MeasureInMeters(3) }
} (In Kotlin, the data class keyword makes sure that two instances of Meter are equal if their amount is equal). Refactor In this step we improve the test and the actual code we have written. Let's start from the naming. @Test
fun `adding 1 meter and 2 meters returns 3 meters`() { val result = Measure(1).add(Measure(2)) assertEquals(Measure(3), result)
} data class Measure(private val amount: Int) { fun add(measure: Measure): Measure { return Measure(3) }
} Let's also generalise the body of the method sum for all integers as we already understand it won't work for another pair of numbers. data class Measure(private val amount: Int) { fun add(measure: Measure): Measure { return Measure(amount + measure.amount) }
} The third step is also when look at the bigger picture. In this example there is little to do, but usually this is the moment when we pay attention on how the new code we are writing fits into the existing codebase (e.g. knowledge duplication, edge cases for some other classes we did not think before, etc.). We do not need to address these concerns right away, but it is good to note them down so we can tackle them once we have done satisfying the bit of specifications we are currently working on. Once we are happy with the quality of the code we have just written, we can restart the three steps process. The focus will be either another test for the bit of specification we are focusing on (e.g. adding 2 negative integers) or a test for another bit of the specifications. Compared to writing tests after the implementation, the main benefit of TDD is that it becomes much harder to write code that is not tested. However, be mindful that we can still write buggy code even if we use TDD as described in the test coverage is not enough section. Recommended reads Test-Driven Development: By Example - Kent Beck Growing Object-Oriented Software, Guided by Tests - Steve Freeman, Nat Pryce Shameless green, chapter 1 of 99 bottles of OOP, Sandy Metz Test contravariance - Robert C. Martin "Testing shows the presence, not the absence of bugs" - Edsger W. Dijkstra London vs Chicago school, contributing-tests wiki - Justin Searls Need driven development, Mock Roles, not Objects - Steve Freeman, Nat Pryce, Tim Mackinnon, Joe Walnes London vs Chicago - Robert C. Martin, Sandro Mancuso Teach me back I really appreciate any feedback about the book and my current understanding of software design.

